  return (
    <div className="p-4 bg-white shadow-md rounded-md text-center">
      <h2 className="text-xl font-bold">Predicted Career:</h2>
      <p className="text-lg">{career}</p>
    </div>
  );
};

export default PredictedCareer; // ✅ Ensure this line exists
